$.bcJ=A.b(["Drs. Juniarto Rojo Prasetyo, MPM., Ed.D adalah pencetus berdirinya Lembaga Sertifikasi Geospasial pada tahun 2016. Lahir di Semarang, Jawa Tengah pada tahun 1957. Setelah menyelesaikan Pendidikan di SMA Negeri I-II Semarang pada tahun 1976, kemudian melanjutkan kuliah di Fakultas Geografi Universitas Gadjah Mada, Yogyakarta tahun 1977. Dengan mengambil jurusan Hidrologi yang berhasil diselesaikan pada bulan Agustus 1983.  ","Pada tahun 1984 hijrah ke Jakarta, karena diterima sebagai Pegawai Negeri Sipil di Departemen Transmigrasi (sekarang Kementerian Desa, Pembangunan Daerah Tertinggal, dan Transmigrasi). Ditempatkan di unit Inspektorat Penyiapan dan Pemukiman Jenderal, membuatnya banyak mengenal daerah pemukiman transmigrsi yang telah diaudit.","Pada tahun 1994 mendapat Bea Siswa dari Overseas Training Office (OTO) di Bappenas untuk melanjutkan studi S2 di Amerika Serikat. Program studi yang diambil adalah Urban Planning di University of Cincinnati (UC), Ohio. Selama kuliah di UC sejak September 1994 hingga Januari 1995, merasa tidak sesuai Program Studi Urban Planning yang diambil.  Akhirnya pindah ke untiversitas lain di negara bagian yang berbeda. Selanjutnya terhitung sejak April 1994 diterima di Carnegie Mellon University, Pittsburgh, Pennsylvania. Bulan Agustus 1996 program studi Masters of Public management dapat diselesaikan dengan baik.","Berkat bea siswa dari Yayasan IPWIJA dapat melanjutkan studi S3 pada tahun 1998. Studi S3 yang diambil adalah Higher Education Management di Pittsburgh University. Tepat pada bulan Mei tahun 2005, program Doktor dapat diselesaikan dan diwisuda. Sempat mendapat Optional Practical Training (OPT) Program selam 4 tahun terhitung 2005 \u2013 2009.","Sempat menjadi Wakil Ketua STIE IPWIJA Bidang Akademik  (sekarang Universitas IPWIJA) dari tahun 2010 \u2013 2022. Kegiatan lain yang masih dijalani adalah sebagai Ketua Lembaga Kajian Pelatihan Manajemen (LKPM) yang bergerak di pelatihan Pengadaan Barang/ Jasa Pemerintah. "],t.s)
$.bcI=A.b(["Drs. Sumartono, M.Si., lahir di Kulon Progo, Daerah Istimewa Yogyakarta pada tanggal 3 Maret 1958. Pendidikan dasar di SD Negeri Janten Kulon Progo, lulus tahun 1970. Pendidikan SMP diperoleh dari SMP Negeri 1 Wates Kulon Progo, lulus tahun 1973, kemudian menempuh Pendidikan SMA di SMA Negeri 1 Wates Kulon Progo, lulus tahun 1976. Pendidikan Sarjana Strata 1 Jurusan Geografi Kependudukan dan Demografi diperoleh dari Universitas Gadjah Mada (UGM) pada tahun 1983. Gelar Magister Sains di bidang Sosiologi Perdesaan diperoleh dari Institut Pertanian Bogor (IPB) pada tahun 2012.","Tahun 1984-1988 bekerja sebagai THLP pada Direktorat Tata Guna Tanah, Direktorat Jenderal Agraria, Departemen Dalam Negeri. Sejak tahun 1989 bekerja sebagai dosen UT dan ditugaskan oleh pimpinan Universitas Terbuka (UT) sebagai staf dosen FMIPA yang diperbantukan di Pusat Pengujian UT. Tahun 1996/1997 sampai tahun 2008 oleh pimpinan UT diberikan tugas tambahan sebagai Kepala Sekolah Menengah Pertama (SMP Dharma Karya) dibawah naungan Yayasan Pembina UT. Sejak tahun 2009 bekerja sebagai staf dosen pada Program Studi S1 Perencanaan Wilayah dan Kota (PWK) Fakultas Sains dan Teknologi (FST) Universitas Terbuka. Mata kuliah yang menjadi ampuan antara lain (a) Kependudukan, (b) Dasar-dasar Geografi, (c) Analisis Lokasi dan Pola Keruangan, dan (d) Sistem Sosial. Publikasi artikel karya ilmiah pada jurnal tingkat nasional seperti pada Jurnal Matematika Sains dan Teknologi (UT); Jurnal Sosial Budaya, dan Jurnal Predestinasi yang diterbitkan oleh Universitas Negeri Makasar (UNM). Publikasi artikel jurnal internasional pada Jurnal Komunitas \u201cInternational Journal of Indonesian Society and Culture\u201d, berjudul \u201cBakul: Contribution of Rural Women to Family Economy through Informal Sector Activities\u201d. Bidang penelitian yang ditekuni adalah bidang kependudukan terutama untuk tema yang terkait dengan migrasi penduduk. Salah satu hasil penelitiannya berjudul \u201cProses Pengambilan Keputusan dan Adaptasi Migran Sirkuler di Kecamatan Pamulang Kota Tangerang Selatan\u201d. Purna tugas sebagai dosen di UT terhitung mulai tanggal 1 April 2023.","Aktivitas tambahan sehari-hari yang pernah dilakukan sebelum pensiun sebagai dosen UT adalah (a) sebagai Ketua Bidang Pendidikan Yayasan Pendidikan Insan Indonesia (YPII) dibawah binaan UT, pada tahun 2009 sd 2011; (b) sebagai asesor akreditasi sekolah jenjang pendidikan SD dan SMP wilayah Provinsi Banten (sejak tahun 2000 sampai dengan tahun 2018). Aktivitas sehari-hari pada saat ini (2019 sd 2027) sebagai anggota Badan Pengawas Yayasan Pendidikan Dharma Ananda Indonesia (YDAI) dibawah binaan UT dan sebagai Penasehat Badan Musyawarah Perguruan Swasta (BMPS) Provinsi Banten (tahun 2023 sd 2027). Kegiatan lainnya sebagai anggota Badan Pendiri PT LSP Geospasial. ","Email yang dapat dihubungi adalah soemartono.ut@gmail.com"],t.s)
